  langs:
  - csharp
  - vb
  name: GetItemsAndHeadingsQueryAsync(bool, CancellationToken, params int[])
  nameWithType: WebPanelProvider.GetItemsAndHeadingsQueryAsync(bool, CancellationToken, params int[])
  fullName: SuperOffice.CRM.Lists.WebPanelProvider.GetItemsAndHeadingsQueryAsync(bool, System.Threading.CancellationToken, params int[])
  type: Method
  assemblies:
  - SoDataBase.BusinessLogic
  namespace: SuperOffice.CRM.Lists
  summary: Create a query for for reading the items and headings of a list.
  remarks: >-
    The <xref href="SuperOffice.CRM.Lists.MDOProviderBase._listInfo" data-throw-if-not-resolved="false"></xref> is populated.
                <p></p>The resulting query will contain an OR clause in the grouplink join if selectedIds != null:
                <pre><code class="lang-csharp">select distinct c.* from crm5.category c inner join crm5.categorygrouplink cg
                on c.category_id = cg.category_id and
                (cg.group_id = 1 or cg.category_id in (1,2,3))</code></pre>
                This works as long as we do not fetch any of the fields from the grouplink table (that would break the distinct
                clause and cause unwanted row multiplication).
  example: []
  syntax:
    content: protected override Task<ListTableRows.CustomSearch> GetItemsAndHeadingsQueryAsync(bool bFlattened, CancellationToken cancellationToken, params int[] selectedIds)
    parameters:
    - id: bFlattened
      type: System.Boolean
      description: Force the list to be flattened.
    - id: cancellationToken
      type: System.Threading.CancellationToken
      description: ''
    - id: selectedIds
      type: System.Int32[]
      description: Id's in the list that will be forced to be included, regardless of other filtering.
    return:
      type: System.Threading.Tasks.Task{SuperOffice.CRM.Lists.ListTableRows.CustomSearch}
      description: Query for reading the items and headdings of a list.
